The test can work something like this:
 1. OnClientConnected();
 2. Update watch path.
 3. Post quit delayed task for delay_ + 0.1s
 4. message_loop_.Run();
 5. Verify that the restart closure wasn't called.
 6. OnClientDisconnected();
 7. If the restart closure still hasn't been called then message_loop_.Run() which quits when it's called.

I don't think this will be flaky. Even if the watcher doesn't notice the change in step 4 it should notice it in 7. The test may sometimes still succeed when restart is not inhibited properly, but I think that's acceptable.

