Don't bother resolving only if the destination_url is invalid. GURL's .h file says that it accepts absolute URLs as well. The advice to bail on an empty arg is a good idea though, to prevent surprises. So, my recommendation is:

} else {
  const string16& relative_url = V8ValueToUTF16(args[0]);
  WebKit::WebView* webview = render_view()->GetWebView();
  if (!relative_url.empty() && webview) {
    GURL current_url(webview->mainFrame()->document().url());
    destination_url = current_url.Resolve(relative_url);
  }
}

