I'd restructure this code like so. The main advantages are not passing by value, and helping the compiler perform NRVO:

namespace {

GURL ConvertForcedInstantURLToTemplateURL(...) {
}

}  // namespace

...

string16 TryToExtractSearchTermsFromURL(const GURL& url, Profile* profile) {
  string16 search_terms;

  TemplateURLService* service = ...;
  TemplateURL* template_url = ...;

  if (template_url) {
    if (IsForcedInstantURL(url)) {
      GURL converted_url = Convert...(url);
      if (template_url->HasSearchTermsReplacementKey(converted_url))
        template_url->ExtractSearchTermsFromURL(converted_url, &search_terms);
    } else {
      if (template_url->Has...(url))
        template_url->Extract...(url, &search_terms);
    }
  }

  return search_terms;
}

