  if (areInterpolable(left, right))
    // interpolate
  else
    // do something else
}

I really dislike the inconsistent naming! Surely the interpolate() method does interpolation, so what is the 'something else'?!

A more consistent scheme is ...

blend(left, right, fraction) {
