    // interpolate linearly
  else
    // do something else
}

There are only actually four calls to the API, though:
1. ui/views/widget/desktop_aura/desktop_window_tree_host_win.cc:    GetWidget()->non_client_view()->GetWindowMask(size, path);
2. ui/views/widget/desktop_aura/desktop_window_tree_host_x11.cc:      widget->non_client_view()->GetWindowMask(bounds_.size(), &window_mask);
3. ui/views/win/hwnd_message_handler.cc:    delegate_->GetWindowMask(gfx::Size(window_rect.right - window_rect.left,
4. ui/views/window/non_client_view.cc:  frame_view_->GetWindowMask(size, window_mask);

Of those only #2 and #3 are actual applications of the mask to a region, and #2 already special-cases the empty case as per the GetWindowMask requirements.

So I think it makes sense to change the SkPath to Hrgn API to return an empty region for an empty path, document that behaviour in the comment on the function, and fix call-site #3 to special-case empty to mean no shape should be applied.

These fake classes limit us to shallow tests of the class' correctness. How this class works with threads is super important, so we need to make sure that the "fakes" or "mocks" ensure that threading is WAI.

One way we could do this would be to a mockable hook to this class, with some additional logic verify that we are running on |thread_|, e.g.

RegisterFeature(...) {
  // check that we are sequenced on thread_
  return MockRegisterFeature(type, incoming_processor);
}

MOCK_METHOD2(MockRegisterFeature, BlimpMessageProcessor*(type, incoming_processor).

That would ensure that the right methods are being called on the right thread.

